  input: '"TEXT","F3XN","","Regarding each of the three letters (Year End Report,
    7/01/03, Amended Mid-Year Report, 1/01/03-6/30/03, and April Quarterly Report,
    1/01/04-3/31/04), it is committee policy to establish best efforts by: Clearly
    requesting the contributor information in our original solicitation and informing
    the contributor of the requirements of federal law. I have enclosed an example
    of a reply device sent with each solicitation. As a follow up, we make a phone
    call and/or send the enclosed form letter to each non-respondent within 30 days.
    Should the information be received after the contributor has been reported, we
    would file an amended report.  Regarding the Amended Mid-Year Report, 1/01/03-6/30/03,
    our calculations indicate our administrative ratio is consistent at 36 percent
    federal dollars for each disbursement on Schedule H4. If we have miscalculated,
    I request your further assistance in understanding specifically which disbursement
    or disbursements have caused this problem. Regarding the Year End Report, 07/01/03-12/31/30,
    we have corrected data entry errors that we believe will reconcile the allocation
    issues cited in your third, eighth, ninth and tenth bullets. Regarding the fifth
    bullet, the $49,000 transfers you refer to are not individual transfers, but rather
    the $49,000 is an aggregate total for the year. Our electronic filing vendor assures
    me the underlying data in our filing is correct and cannot explain why it is not
    being reflected properly. I am left to believe this is a software glitch. The
    individual transfers from our non-federal account for this filing period are as
    follows: $6,000 transfer on 7/22/03; $3,000 transfer on 7/28/03; $2,000 transfer
    on 9/17/03; $24,000 transfer on 12/30/03. Thank you once again for your helpful
    assistance. I expect our amendments along with these explanations will clarify
    the issues you have called to our attention. If there are any lingering issues
    requiring clarification, please do not hesitate to contact us.",""'
